import logo from './logo.svg';
import './App.css';
import Starlink from './Starlink';
import LatestNews from './LatestNews';
import RocketInfo from './RocketInfo';
import LaunchPhotos from './LaunchPhotos';

function App() {
  return (
    <div className="App">
      <Starlink/>
      <LatestNews/>
      <LaunchPhotos/>
      <RocketInfo/>
    </div>
  );
}

export default App;
